import CartItem from './cart';
import Song from './song';

export default function CartList(props){
    return (
        <ListGroup style={{backgroundColor: 'pink'}}>
            {props.cart.map((song, index) => (
        <CartItem item={song} cartRemover={props.cartRemover}/>
      ))}
        </ListGroup>
    );
}
